import './Expenses.css'
import ExpenseItem from "./ExpenseItem";

function Expenses() {
    const expenses = [
        {
          id: 'e1',
          title: 'Toilet Paper',
          price: 94.12,
          date: new Date(2020, 7, 14),
        },
        {
          id: 'e2',
          title: 'New TV',
          price: 799.49,
          date: new Date(2021, 2, 12)
        },
        {
          id: 'e3',
          title: 'Car Insurance',
          price: 294.67,
          date: new Date(2021, 2, 28),
        },
        {
          id: 'e4',
          title: 'New Desk (Wooden)',
          price: 450,
          date: new Date(2021, 5, 12),
        },
      ];
      
    return (
        <div className="expenses">
            {expenses.map((expense, index) => (
                <ExpenseItem
                    key={index}
                    title={expense.title}
                    price={expense.price}
                    date={expense.date}
                />
            ))}
        </div>
        // <div>
        //     <ExpenseItem
        //         title={itemProps.items[0].title}
        //         price={itemProps[0].price}
        //         date={itemProps[0].date}
        //     />
        // </div>
    )
}

export default Expenses
